import { Box, IconButton } from '@mui/material';
import { DataGrid } from '@mui/x-data-grid';
import { Check as CheckIcon } from '@mui/icons-material';

const OrderList = ({ orders, onConfirm }) => {
  const columns = [
    { field: 'shippingInfo.fullName', headerName: 'Tên khách hàng', width: 200 }, // Ensure this is correct
    {
      field: 'items',
      headerName: 'Sản phẩm',
      width: 200,
      renderCell: (params) => (
        <div>
          {params.value.map(item => (
            <div key={item.productId}>{item.name} (x{item.quantity})</div>
          ))}
        </div>
      )
    },
    { field: 'totalAmount', headerName: 'Tổng tiền', width: 150 },
    { field: 'status', headerName: 'Trạng thái', width: 150 },
    {
      field: 'actions',
      headerName: 'Thao tác',
      width: 130,
      renderCell: (params) => (
        <Box>
          <IconButton color="primary" onClick={() => onConfirm(params.row._id)}>
            <CheckIcon />
          </IconButton>
        </Box>
      )
    }
  ];

  return (
    <DataGrid
      rows={orders}
      columns={columns}
      pageSize={10}
      rowsPerPageOptions={[10]}
      getRowId={(row) => row._id}
      autoHeight
      disableSelectionOnClick
      loading={orders.length === 0}
    />
  );
};

export default OrderList;
